import React from "react";
import { Fragment } from "react";
import {Alert,Row,Col} from "react-bootstrap"

const Dashboard=()=>{
    return (
<Fragment>

  <Row>
    <Col sm={3}>
    <Alert variant="dark">
        <Alert.Heading>
            WELCOME ADMIN
        </Alert.Heading>
    </Alert>
    </Col>
    <Col sm={9}>1 of 3</Col>
  </Row>
</Fragment>
    )
}
export default Dashboard;
